import {verifyTokens} from "../../../auths/verifyTokens"
import useAccess from "../../../auths/accessToken"


const Get_cashStream = async (pageNo="", success, fail) => {
    const {access, setAccess} = useAccess('')

    const set_access = (Access_text) => {
      setAccess(Access_text)
    }

    verifyTokens(access, set_access)

    const response = await fetch(
          `/ledger/cashstream/`,
          {
              method: 'GET',
              headers: {
                  'Content-Type': 'Application/JSON',
                  'Authorization': `Bearer ${access}`,
              }
          }
      );

    const text = await response.text();
    if (response.status === 401) {
      console.log("accesstoken not valid");
      alert("you are not authorized to view this page")
      window.location.assign("/index/login/");
      return [];
    }
    if (response.status === 200) {
      console.log("success", JSON.parse(text));
      success(JSON.parse(text));
    } else {
      console.log("failed", text);
      Object.entries(JSON.parse(text)).forEach(([key, value])=>{
        fail(`${key}: ${value}`);
      });
    }
  };

  export default Get_cashStream
